// App.js

import React from 'react';
import './App.css';

import ChatBox from './components/ChatBox';
import MoviePanel from './components/MoviePanel';
import GraphPanel from './components/GraphPanel';

import buddingBoxIcon from "./assets/icon/"

const App = () => {
  return (
    <div className="app-container">
      <div className="app-header">
        <h1>Natural Language Information Retrieval from Domain-Specific Videos</h1>
      </div>
      <div className="movie-panel">
        <MoviePanel />
      </div>
      <div className="graph-panel">
        <GraphPanel />
      </div>
      <div className="settings-panel">
        {/* Add your settings panel component here */}
        <p>Settings</p>
        <button>
          <img></img>
        </button>
        {/* You can customize the settings panel as needed */}
      </div>
      <div className="chatbox">
        {/* Chatbox Panel */}
        <ChatBox />
      </div>
    </div>
  );
};

export default App;
